import {
  Box,
  Checkbox,
  FormControlLabel,
  Grid,
  TextField,
} from "@material-ui/core";
import React, { useEffect, useState } from "react";
import PlacesAutocomplete from "react-places-autocomplete";
import { Field } from "formik";
import { colors } from "../../../../themes/colors";
import { useStyles } from "../../hooks/Styles";
// import Question from "../../../images/Question.png";
import FormikControl from "../../hooks/FormikControl";
import Buttons from "./Components/Buttons";
import Select from "./Components/Select";
import { FormGroup } from "react-bootstrap";

function From2({ onReturn, TypeLenseigne, formik, AddressesOption }) {
  const classes = useStyles();
  console.log(formik);
  // console.log(formik.errors.nomentreprise);
  return (
    <Box className={classes.ContainerForm2}>
      <Box className={classes.inputBox}>
        <Field
          variant="outlined"
          required
          fullWidth
          id="nomentreprise"
          label="Nom de l'enseigne"
          name="nomentreprise"
          as={TextField}
          error={
            formik.errors.nomentreprise && formik.touched.nomentreprise
              ? true
              : false
          }
        />
      </Box>
      <Box className={classes.inputBox}>
        <PlacesAutocomplete
        // value={adresse}
        // onChange={setAdresse}
        // onSelect={handleAddressSelect}
        >
          {({
            getInputProps,
            suggestions,
            getSuggestionItemProps,
            loading,
          }) => (
            <>
              <Field
                variant="outlined"
                required
                fullWidth
                id="Addresses"
                label="Addresses"
                name="Addresses"
                as={TextField}
                error={
                  formik.errors.Addresses && formik.touched.Addresses
                    ? true
                    : false
                }
                // {...getInputProps({
                //   label: "Adresse",
                //   placeholder: "Entrez l'adresse",
                // })}
              />
              <div>
                {loading ? <div>Chargement...</div> : null}

                {suggestions.map((suggestion, i) => {
                  const style = {
                    backgroundColor: suggestion.active
                      ? colors.brown
                      : "#fafafa",
                  };
                  return (
                    <div
                      key={i}
                      {...getSuggestionItemProps(suggestion, { style })}
                    >
                      {suggestion.description}
                    </div>
                  );
                })}
              </div>
            </>
          )}
        </PlacesAutocomplete>
      </Box>

      <Box className={classes.inputBox}>
        {/* <FormikControl
            control="checkbox"
            label="Type de l'enseigne"
            name="TypeLenseigne"
            options={TypeLenseigne}
            field={formik.values}
          /> */}

        {TypeLenseigne.map((option) => {
          return (
            <>
              <Field type='checkbox' name="TypeLenseigne" value={option.value} />
            </>
          );
        })}
      </Box>
      <Buttons />
    </Box>
  );
}

export default From2;
